function makeFooter(dd){
    dd.footer = function(currentPage, pageCount, pageSize) {
	    if(pageCount > 1){
            return { text: 'Pg. ' + currentPage.toString() + '/' + pageCount, fontSize: 8, alignment: 'right', margin: [0,0,40,0],};
	    }
    }
}

function makeNumEquipaPorConcelho(dd, numEquipas, total){
    const content = {
        table: {
            headerRows: 1,
            widths: ['*', '*'],
            body: [
                [{text: 'Concelho', margin: [10, 5]}, {text: 'Equipas', margin: [10, 5]}]
            ]
        },
        layout: 'lightHorizontalLines'
    }

    numEquipas.forEach(equipa => {
        const row = [{
            text: equipa.nome,
            margin: [20, 5]
        }, 
        {
            text: equipa.numEquipas,
            margin: [20, 5]
        }];
        content.table.body.push(row);
    });

    const totalRow = [{
        margin: [10, 5],
        text: 'Total',
        fillColor: '#eeeeee',
        bold: true
    }, 
    {
        margin: [20, 5],
        text: `${total}`,
        fillColor: '#eeeeee',
        bold: true
    }];

    content.table.body.push(totalRow);

    dd.content.push(content);
}

