function makeContentResultados(dd, data, fase){

    // na primeira fase  3 porque so duas equipas apuradas que ocupam a linha 2 e 3
    // nas fases seguintes  2 porque s  apurada uma equipa na linha 2
    let k = (fase == 1) ? 3 : 2;

    if(fase == 100){
        dd.content.push({
            text: `${data.campo == 1 ? 'Final' : '3 e 4 Lugar'}`,
            fontSize: 20,
            bold: true,
            margin: [0, 20, 0, 10],
            color: '#455cc7',
            alignment: 'center'
        })
    }
    
    const _table = {
        table: {
            headerRows: 2,
            widths: ['auto', 'auto', '*', '*', 'auto', 'auto'],
            body: [
                [{text: `Campo ${data.campo}`, bold: true, fontSize: 14, colSpan: 6, alignment: 'center', border: [false, false, false, false]}, '', '', '', '', ''],
                [
                    {text: ' '},
                    {text: 'Equipas', bold: true},
                    {text: 'Jogadores', colSpan: 2, bold: true},
                    {text: ''},
                    {text: 'Jogos Ganhos', bold: true},
                    {text: 'Pontos', bold: true},
                ]
            ]
        },
        margin: [0,0,0,20],
        layout: {
            hLineWidth: function(i, node) {
                if(i === 1){
                    return 0;
                } else if(i === 2){
                    return 2;
                } else {
                    return 0.3;
                }
            },
            vLineWidth: function(i, node) {
                return 0;
            },
            hLineColor: function(i, node) {
                if(i > 2) {
                    return '#dddddd';
                } else {
                    return 'black';
                }
    		},
            vLineColor: function(i, node) {
                if(i === 1 || i === 3 || i === 5) {
                    return 'gray';
                } else {
                    return 'black';
                }
    		},
    		fillColor: function(i, node){
    		    if(i > 1 && i <= k){
    		        return '#eeeeee';
    		    }
    		}
        }
    }

    let ordem = 1;
    data.classificacao.forEach((equipa) => {
        const classificacaoRow = [
            {text: `${ordem++}`, alignment: 'center', margin: [5, 5]},
            {text: `${equipa.equipaId}`, fontSize: 10, alignment: 'center', margin: [0, 6]},
            {text: `${equipa.primeiroElemento}`, fontSize: 10, margin: [0, 6]},
            {text: `${equipa.segundoElemento}`, fontSize: 10, margin: [0, 6]},
            {text: `${equipa.vitorias}`, alignment: 'center', margin: [0, 5]},
            {text: `${equipa.pontos}`, alignment: 'center', margin: [0, 5]},
        ];
        _table.table.body.push(classificacaoRow);
    });

    dd.content.push(_table);
}

function makeEquipasContent(dd, data){
    const widths = ['auto', '*'];
    const tableHeader = [
        {text: 'Equipa', bold: true},
        {text: 'Jogadores', bold: true},
    ];


    if(!data.hasOwnProperty('localidade')){
        widths.push('*');
        tableHeader.push({text: 'Localidade', bold: true, alignment: 'center'});
    } else {
        dd.content.push({
            text: `${data.localidade.nome}`,
            alignment: 'center',
            bold: true,
            fontSize: 18
        });
    }

    if(!data.hasOwnProperty('escalao')){
        if(!data.hasOwnProperty('localidade')){
            widths.push('auto');
        } else {
            widths.push('*');
        }
        tableHeader.push({text: 'Escalo', bold: true, alignment: 'center'});
    } else {
        dd.content.push({
            text: `${data.escalao.designacao} (${data.escalao.sexo == 1 ? 'Masculino' : 'Feminino'})`,
            alignment: 'center',
            fontSize: 14,
            margin: [0, 5, 0, 0]
        });
    }

    const content = {
        table: {
            headerRows: 2,
            dontBreakRows: true,
            widths: widths,
            body: []
        },
        layout: {
            hLineWidth: function(i, node) {
                if(i === 0){
                    return 0;
                } else if(i === 1){
                    return 2;
                } else {
                    return 0.3;
                }
            },
            vLineWidth: function(i, node) {
                return 0;
            },
            hLineColor: function(i, node) {
                if(i > 1) {
                    return '#dddddd';
                } else {
                    return 'black';
                }
    		}
        }
    }

    content.table.body.push(tableHeader);
    
    data.listaEquipas.forEach(equipa => {
        const row = [
            {text: `${equipa.equipaId}`, alignment: 'center', margin: [5, 10]},
            {stack: [
                {text: `${equipa.primeiroElemento}`, fontSize: 10, margin: [0, 4, 0, 2]},
                {text: `${equipa.segundoElemento}`, fontSize: 10, margin: [0, 2, 0, 4]},
            ]}
        ];
        if(!data.hasOwnProperty('localidade')){
            row.push({text: `${equipa.localidade}`, alignment: 'center', margin: [5, 10]});
        }
    
        if(!data.hasOwnProperty('escalao')){
            row.push({text: `${equipa.escalao} (${equipa.sexo})`, alignment: 'center', margin: [5, 10]});
        }

        content.table.body.push(row);
    });

    

    dd.content.push(content);
}

